import React from 'react';
import { Box, Flex, Button, Heading, Spacer } from '@chakra-ui/react';
import { Link as RouterLink } from 'react-router-dom';

function Navbar() {
  return (
    <Box bg="blue.500" px={4} py={3}>
      <Flex maxW="container.xl" mx="auto" alignItems="center">
        <RouterLink to="/">
          <Heading size="md" color="white">Opinion Poll</Heading>
        </RouterLink>
        <Spacer />
        <Flex gap={4}>
          <RouterLink to="/create">
            <Button colorScheme="whiteAlpha">Create Poll</Button>
          </RouterLink>
          <RouterLink to="/admin">
            <Button colorScheme="whiteAlpha">Admin</Button>
          </RouterLink>
        </Flex>
      </Flex>
    </Box>
  );
}

export default Navbar;
